"use client"

import { useState, useMemo } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import {
    Search, Grid, Shield, BookOpen, Activity,
    Briefcase, Cpu, Sparkles, Brain, Dumbbell,
    GraduationCap, Video, X, ChevronRight, Zap,
    ShieldAlert, Globe
} from 'lucide-react';
import { PROTOCOL_REGISTRY as ALL_PROTOCOLS, UnifiedProtocol } from '@/data/unifiedRegistry';
import { NeuralLinkChat } from '@/components/ai/NeuralLinkChat';
import TokenMeter from '@/components/dashboard/TokenMeter';
import BurnRate from '@/components/dashboard/BurnRate';
import WallOfSovereignty from '@/components/dashboard/WallOfSovereignty';
import AlabamaLiteracyModule from '@/components/modules/AlabamaLiteracyModule';
import NeuralInsights from '@/components/dashboard/NeuralInsights';
import ProfessionalBackground from '@/components/dossier/ProfessionalBackground';
import { useAuth } from '@/context/AuthContext';
import { cn } from '@/lib/utils';
import Link from 'next/link';
import React from 'react';

export default function AIHubClient() {
    const { user } = useAuth();
    const [searchQuery, setSearchQuery] = useState("");
    const [activeCategory, setActiveCategory] = useState<string>("All");
    const [selectedProtocol, setSelectedProtocol] = useState<UnifiedProtocol | null>(null);

    // Categories for the hub
    const categories = [
        { id: "All", label: "All Nodes", icon: Grid },
        { id: "Global", label: "Global AI", icon: Globe },
        { id: "Strategic", label: "Strategic Leadership", icon: Briefcase },
        { id: "Instructional", label: "Instructional Core", icon: BookOpen },
        { id: "Operational", label: "Ops & Logistics", icon: Shield },
        { id: "Visual", label: "Visual Media", icon: Video },
        { id: "Wellness", label: "Wellness & Support", icon: Activity },
        { id: "Cognitive", label: "Cognitive Training", icon: Brain },
    ];

    // Cognitive and Media nodes that aren't text-based protocols
    const specializedNodes = useMemo(() => [
        {
            id: 'cognitive-gym',
            name: 'Cognitive Gym',
            description: 'Interactive mental fitness and executive function training.',
            category: 'Cognitive',
            icon: Dumbbell,
            link: '/gym',
            color: 'text-pink-400',
            border: 'border-pink-500/20'
        },
        {
            id: 'principal-academy',
            name: 'Cognitive Academy',
            description: 'Guided pathways to mastery in educational leadership.',
            category: 'Cognitive',
            icon: GraduationCap,
            link: '/academy',
            color: 'text-indigo-400',
            border: 'border-indigo-500/20'
        },
        {
            id: 'video-studio',
            name: 'Media Studio',
            description: 'Synthesize briefs into high-fidelity avatar presentations.',
            category: 'Operational',
            icon: Video,
            link: '/studio',
        }
    ] as UnifiedProtocol[], []);

    const filteredProtocols = useMemo(() => {
        const protocols = ALL_PROTOCOLS.map(p => ({
            ...p,
            category: p.category || "Strategic", // Default category if not specified
            link: p.link || `/generators/${p.id}` // Default link if not specified
        }) as UnifiedProtocol).filter(gen => {
            const matchesSearch = gen.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
                gen.description.toLowerCase().includes(searchQuery.toLowerCase());
            const matchesCategory = activeCategory === "All" || gen.category === activeCategory;
            return matchesSearch && matchesCategory;
        });

        // Add specialized nodes if they match
        const extraNodes = specializedNodes.filter(node => {
            const matchesSearch = node.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
                node.description.toLowerCase().includes(searchQuery.toLowerCase());
            const matchesCategory = activeCategory === "All" || node.category === activeCategory;
            return matchesSearch && matchesCategory;
        });

        return [...protocols, ...extraNodes];
    }, [searchQuery, activeCategory, specializedNodes]);

    return (
        <main className="content-stage min-h-screen bg-white-smoke text-slate-900 overflow-hidden relative">
            <ProfessionalBackground />

            {/* GRID OVERLAY */}
            <div className="absolute inset-0 bg-[url('/images/grid.svg')] opacity-[0.03] pointer-events-none" />

            <div className="relative z-10 max-w-7xl mx-auto px-6 py-8 h-full flex flex-col">
                {/* Header */}
                <header className="mb-8 flex flex-col md:flex-row justify-between items-start md:items-end gap-6 border-b border-white/5 pb-8">
                    <div className="space-y-2">
                        <div className="flex items-center gap-3 px-3 py-1 rounded-full bg-noble-gold/10 border border-noble-gold/20 text-noble-gold text-[10px] font-black uppercase tracking-[0.2em] w-fit">
                            <Cpu className="w-3.5 h-3.5" />
                            System Node: Neural Grid
                        </div>
                        <h1 className="text-4xl md:text-6xl font-black tracking-tighter text-slate-900 uppercase italic">
                            The <span className="text-electric-cyan">Neural</span> Hub
                        </h1>
                        <p className="text-slate-500 max-w-xl text-sm font-medium uppercase tracking-[0.1em]">
                            Unified tactical interface for strategic protocols & cognitive synthesis.
                        </p>
                    </div>

                    <div className="w-full md:w-96 relative group">
                        <Search className="absolute left-4 top-1/2 -translate-y-1/2 w-4 h-4 text-slate-400 group-focus-within:text-electric-cyan transition-colors" />
                        <input
                            type="text"
                            placeholder="Search Agents & Tools..."
                            value={searchQuery}
                            onChange={(e) => setSearchQuery(e.target.value)}
                            className="w-full bg-white border border-slate-200 rounded-2xl pl-12 pr-4 py-3 text-sm focus:outline-none focus:border-electric-cyan/50 focus:ring-1 focus:ring-electric-cyan/20 transition-all font-medium text-slate-900 shadow-sm"
                        />
                    </div>
                </header>
                {/* Agent Status Bar - Live Platform State */}
                <div className="flex items-center gap-6 mb-8 px-4 py-3 bg-slate-900 rounded-2xl overflow-hidden relative group">
                    <div className="absolute inset-0 bg-gradient-to-r from-electric-cyan/5 via-transparent to-sovereign-gold/5 opacity-50" />

                    <div className="flex items-center gap-3 relative z-10 border-r border-white/10 pr-6">
                        <div className="w-2 h-2 rounded-full bg-electric-cyan animate-pulse shadow-[0_0_8px_rgba(0,176,255,0.8)]" />
                        <span className="text-[10px] font-black text-white uppercase tracking-widest">System Active</span>
                    </div>

                    <div className="flex-1 flex items-center gap-8 relative z-10 overflow-hidden">
                        {[
                            { label: 'Strategic Polymath', status: 'SYNTHESIZING', color: 'text-electric-cyan', icon: Brain },
                            { label: 'Compliance Engine', status: 'AUDITING', color: 'text-sovereign-gold', icon: ShieldAlert },
                            { label: 'Neural Link', status: 'CONNECTED', color: 'text-emerald-400', icon: Activity }
                        ].map((agent, i) => (
                            <div key={i} className="flex items-center gap-3 whitespace-nowrap">
                                <agent.icon size={12} className={agent.color} />
                                <div className="flex flex-col">
                                    <span className="text-[8px] font-black text-slate-400 uppercase tracking-tighter">{agent.label}</span>
                                    <span className={cn("text-[9px] font-bold tracking-widest", agent.color)}>{agent.status}</span>
                                </div>
                            </div>
                        ))}
                    </div>

                    <div className="hidden md:flex items-center gap-4 relative z-10">
                        <div className="flex -space-x-2">
                            {[1, 2, 3].map(i => (
                                <div key={i} className="w-6 h-6 rounded-full border-2 border-slate-900 bg-slate-800 flex items-center justify-center text-[8px] font-black text-white">
                                    {String.fromCharCode(64 + i)}
                                </div>
                            ))}
                        </div>
                        <span className="text-[9px] font-black text-slate-400 uppercase tracking-widest">128 active delegates</span>
                    </div>
                </div>

                {/* Categories */}
                <nav className="flex items-center gap-2 mb-8 overflow-x-auto no-scrollbar pb-2">
                    {categories.map((cat) => (
                        <button
                            key={cat.id}
                            onClick={() => setActiveCategory(cat.id)}
                            className={cn(
                                "flex items-center gap-2 px-5 py-2.5 rounded-full text-[10px] font-black uppercase tracking-widest transition-all whitespace-nowrap border shadow-sm",
                                activeCategory === cat.id
                                    ? "bg-electric-cyan text-white border-electric-cyan shadow-lg shadow-electric-cyan/20"
                                    : "bg-white text-slate-500 border-slate-200 hover:bg-slate-50 hover:text-slate-900"
                            )}
                        >
                            <cat.icon className="w-3.5 h-3.5" />
                            {cat.label}
                        </button>
                    ))}
                </nav>

                {/* Bento Grid Command Center */}
                <div className="grid grid-cols-1 lg:grid-cols-4 gap-6 mb-8">
                    {/* Primary Engine (Wide Card) */}
                    <div className="lg:col-span-2">
                        <AlabamaLiteracyModule />
                    </div>

                    {/* Usage Metrics */}
                    <div className="lg:col-span-1">
                        {user && (
                            <TokenMeter
                                tokens={user.usageTokens || 0}
                                tier={user.tier || 'free'}
                            />
                        )}
                    </div>

                    {/* Analytics & Memory */}
                    <div className="lg:col-span-1 flex flex-col gap-6">
                        <BurnRate />
                        <div className="glass-bento flex flex-col justify-center flex-1">
                            <h3 className="text-sm font-black text-slate-900 uppercase tracking-widest mb-3 italic flex items-center gap-2">
                                <Brain className="w-4 h-4 text-electric-cyan" />
                                Memory
                            </h3>
                            <p className="text-[10px] text-slate-500 leading-relaxed uppercase font-black">
                                Neural findings persist across nodes. Use chat to query audited data.
                            </p>
                        </div>
                    </div>
                </div>

                {/* Intelligence Feed */}
                <div className="mb-12">
                    <NeuralInsights />
                </div>

                {/* Wall of Sovereignty Integration */}
                <div className="mb-12">
                    <WallOfSovereignty />
                </div>

                {/* Main Grid Content Organized by Category */}
                <div className="flex-1 overflow-y-auto custom-scrollbar pr-2 pb-20 max-h-[calc(100vh-450px)]">
                    <AnimatePresence mode="popLayout">
                        {categories.filter(c => c.id !== "All").map(category => {
                            const categoryProtocols = filteredProtocols.filter(p => p.category === category.id);
                            if (categoryProtocols.length === 0 && activeCategory !== "All") return null;
                            if (activeCategory !== "All" && activeCategory !== category.id) return null;

                            return (
                                <div key={category.id} className="mb-12 last:mb-0">
                                    <div className="flex items-center gap-4 mb-6 sticky top-0 z-20 bg-white-smoke/80 backdrop-blur-md py-4">
                                        <div className="w-8 h-8 rounded-lg bg-slate-900 flex items-center justify-center text-white">
                                            <category.icon size={16} />
                                        </div>
                                        <h2 className="text-xl font-black tracking-tighter uppercase italic text-slate-900">
                                            {category.label}
                                        </h2>
                                        <div className="h-px flex-1 bg-slate-200" />
                                    </div>

                                    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-4">
                                        {categoryProtocols.map((node, i) => (
                                            <motion.div
                                                key={node.id}
                                                layout
                                                initial={{ opacity: 0, scale: 0.95 }}
                                                animate={{ opacity: 1, scale: 1 }}
                                                exit={{ opacity: 0, scale: 0.95 }}
                                                transition={{ duration: 0.2, delay: i * 0.02 }}
                                                onClick={() => {
                                                    if ((node as any).link) return;
                                                    setSelectedProtocol(node as UnifiedProtocol);
                                                }}
                                                className={cn(
                                                    "p-5 glass-bento cursor-pointer group relative overflow-hidden h-full flex flex-col",
                                                    selectedProtocol?.id === node.id && "border-electric-cyan/50 bg-electric-cyan/5 ring-1 ring-electric-cyan/20"
                                                )}
                                            >
                                                {/* Media/Avatar Preview Section */}
                                                <div className="relative h-32 mb-4 rounded-xl overflow-hidden bg-slate-100 border border-slate-200/50 group-hover:border-electric-cyan/20 transition-colors">
                                                    {node.heroVideo ? (
                                                        <video
                                                            src={node.heroVideo}
                                                            autoPlay
                                                            muted
                                                            loop
                                                            playsInline
                                                            className="w-full h-full object-cover"
                                                        />
                                                    ) : node.heroImage ? (
                                                        <img
                                                            src={node.heroImage}
                                                            alt={node.name}
                                                            className="w-full h-full object-cover"
                                                        />
                                                    ) : (
                                                        <div className="absolute inset-0 flex items-center justify-center bg-gradient-to-br from-slate-50 to-white">
                                                            <div className="absolute inset-0 opacity-[0.03] bg-[url('/images/grid.svg')] bg-[length:20px_20px]" />
                                                            {node.avatar ? (
                                                                <img
                                                                    src={node.avatar}
                                                                    alt={node.name}
                                                                    className="w-20 h-20 rounded-full object-cover border-2 border-white shadow-lg"
                                                                />
                                                            ) : (
                                                                <node.icon size={40} className="text-slate-200" />
                                                            )}
                                                        </div>
                                                    )}

                                                    {/* Category Badge on Image */}
                                                    <div className="absolute top-2 right-2 px-2 py-0.5 rounded-md bg-black/60 backdrop-blur-md text-[8px] font-black text-white uppercase tracking-widest border border-white/10">
                                                        {node.category}
                                                    </div>
                                                </div>

                                                <div className="space-y-3 relative z-10 flex-1">
                                                    <div className="flex items-start justify-between gap-2">
                                                        <div>
                                                            <h3 className="font-black text-[13px] uppercase tracking-wider text-slate-900 group-hover:text-electric-cyan transition-colors leading-tight">
                                                                {node.name}
                                                            </h3>
                                                            <p className="text-[9px] font-bold text-slate-400 uppercase tracking-tighter mt-0.5">
                                                                {node.provider || "EdIntel Sovereign"}
                                                            </p>
                                                        </div>
                                                        <div className={cn(
                                                            "w-7 h-7 rounded-lg flex items-center justify-center shrink-0 border",
                                                            selectedProtocol?.id === node.id ? "bg-electric-cyan border-electric-cyan text-white shadow-lg shadow-electric-cyan/30" : "bg-white border-slate-200 text-slate-400 group-hover:text-electric-cyan group-hover:border-electric-cyan/30"
                                                        )}>
                                                            {node.icon ? <node.icon size={14} strokeWidth={2} /> : <Cpu size={14} strokeWidth={2} />}
                                                        </div>
                                                    </div>

                                                    <p className="text-[10px] font-medium text-slate-600 line-clamp-2 leading-relaxed tracking-tight">
                                                        {node.description}
                                                    </p>

                                                    {/* Tactical Prompt Preview */}
                                                    {node.prompts && node.prompts.length > 0 && (
                                                        <div className="p-2 rounded-lg bg-slate-50 border border-slate-100 group-hover:border-electric-cyan/10 transition-colors">
                                                            <div className="flex items-center gap-1.5 mb-1">
                                                                <Sparkles size={8} className="text-noble-gold" />
                                                                <span className="text-[7px] font-black uppercase tracking-widest text-slate-400">Tactical Insight</span>
                                                            </div>
                                                            <p className="text-[8px] italic font-medium text-slate-500 line-clamp-1">
                                                                "{node.prompts[0]}"
                                                            </p>
                                                        </div>
                                                    )}

                                                    <div className="flex items-center justify-between pt-2 mt-auto">
                                                        <div className="flex items-center gap-2">
                                                            <div className="w-1.5 h-1.5 rounded-full bg-emerald-500 shadow-[0_0_5px_rgba(16,185,129,0.5)]" />
                                                            <span className="text-[8px] font-black uppercase tracking-widest text-slate-400">
                                                                Sync Ready
                                                            </span>
                                                        </div>
                                                        {(node as any).link ? (
                                                            <Link href={(node as any).link} className="flex items-center gap-1 text-[9px] font-black uppercase text-electric-cyan hover:tracking-widest transition-all">
                                                                Launch Protocol <ChevronRight size={10} />
                                                            </Link>
                                                        ) : (
                                                            <div className="flex items-center gap-1 text-[9px] font-black uppercase text-slate-400 group-hover:text-electric-cyan transition-colors">
                                                                Initialize <Zap size={10} fill="currentColor" />
                                                            </div>
                                                        )}
                                                    </div>
                                                </div>
                                            </motion.div>
                                        ))}
                                    </div>
                                </div>
                            );
                        })}
                    </AnimatePresence>
                </div>
            </div>

            {/* Chat Interface Drawer/Overlay */}
            <AnimatePresence>
                {selectedProtocol && (
                    <motion.div
                        initial={{ x: '100%' }}
                        animate={{ x: 0 }}
                        exit={{ x: '100%' }}
                        transition={{ type: 'spring', damping: 25, stiffness: 200 }}
                        className="fixed inset-y-0 right-0 w-full lg:w-[600px] xl:w-[800px] z-[100] bg-black/95 border-l border-white/10 shadow-2xl backdrop-blur-3xl"
                    >
                        <div className="h-full flex flex-col p-6 pt-20 relative">
                            <button
                                onClick={() => setSelectedProtocol(null)}
                                title="Close AI Hub"
                                className="absolute top-6 left-6 p-3 rounded-full bg-white/5 border border-white/10 text-white/40 hover:text-white hover:bg-white/10 transition-all"
                            >
                                <X size={20} />
                            </button>

                            <div className="absolute top-8 right-12 flex items-center gap-2 opacity-50">
                                <div className="w-2 h-2 rounded-full bg-emerald-500 animate-pulse" />
                                <span className="text-[10px] font-black uppercase tracking-widest text-emerald-500">Neutral Sync Active</span>
                            </div>

                            <div className="flex-1 overflow-hidden rounded-[2.5rem] border border-white/5 shadow-2xl">
                                <NeuralLinkChat
                                    protocol={selectedProtocol}
                                    className="h-full border-0 bg-transparent"
                                />
                            </div>
                        </div>
                    </motion.div>
                )}
            </AnimatePresence>

            {/* Backdrop for open drawer */}
            {selectedProtocol && (
                <motion.div
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    exit={{ opacity: 0 }}
                    onClick={() => setSelectedProtocol(null)}
                    className="fixed inset-0 bg-black/60 backdrop-blur-sm z-[90]"
                />
            )}
        </main>
    );
}

'use client';

import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Play, Info, Plus, Search, ChevronRight, Film, Music, Library } from 'lucide-react';
import { SmartHover } from '@/components/ui/SmartHover';

const CATEGORIES = [
    {
        name: 'Featured Protocols', items: [
            { id: '1', title: 'The Sovereign Delegate', thumbnail: '/images/gallery/delegate.jpg', type: 'Strategy' },
            { id: '2', title: 'Neural Link Onboarding', thumbnail: '/images/gallery/onboarding.jpg', type: 'Instructional' },
            { id: '3', title: 'Fragility Analysis', thumbnail: '/images/gallery/fragility.jpg', type: 'Admin' }
        ]
    },
    {
        name: 'Instructional Series', items: [
            { id: '4', title: 'IEP Mastery', thumbnail: '/images/gallery/iep.jpg', type: 'Course' },
            { id: '5', title: 'Medicaid Logic', thumbnail: '/images/gallery/medicaid.jpg', type: 'Course' },
            { id: '6', title: 'Data Sovereignty', thumbnail: '/images/gallery/data.jpg', type: 'Course' }
        ]
    },
    {
        name: 'Cultural Archives', items: [
            { id: '7', title: 'The Griot Legacy', thumbnail: '/images/gallery/griot.jpg', type: 'Archive' },
            { id: '8', title: 'Community Pillars', thumbnail: '/images/gallery/community.jpg', type: 'Archive' },
            { id: '9', title: 'Future Horizons', thumbnail: '/images/gallery/future.jpg', type: 'Archive' }
        ]
    }
];

export default function StudioClient() {
    const [activeHero, setActiveHero] = useState(CATEGORIES[0].items[0]);

    return (
        <main className="min-h-screen bg-black text-white pb-20">
            {/* Hero Section */}
            <div className="relative h-[80vh] w-full overflow-hidden">
                <div className="absolute inset-0 bg-gradient-to-t from-black via-black/20 to-black/40 z-10" />
                <div className="absolute inset-0 bg-gradient-to-r from-black via-transparent to-transparent z-10" />

                {/* Simulated Backdrop */}
                <div className="absolute inset-0 bg-slate-900 flex items-center justify-center">
                    <Film className="w-20 h-20 text-slate-800 animate-pulse" />
                </div>

                <div className="relative z-20 h-full flex flex-col justify-center px-12 max-w-2xl space-y-6">
                    <motion.div
                        initial={{ opacity: 0, x: -50 }}
                        animate={{ opacity: 1, x: 0 }}
                        className="space-y-4"
                    >
                        <div className="flex items-center gap-2">
                            <Library className="text-electric-cyan w-5 h-5" />
                            <span className="text-xs font-black uppercase tracking-[0.3em] text-electric-cyan">Studio Griot Preferred</span>
                        </div>
                        <h1 className="text-7xl font-black uppercase tracking-tighter leading-none italic">
                            {activeHero.title}
